import React from 'react'
import './css/top_nav.css'

export default function TopNav(){
    return(
            <nav id='top_nav'>
                <span><a href="#contact_info" className="link underline">Contactos</a></span>
                <span><Link to='/Faq' className="link underline">Preguntas frecuentes</Link></span>
            </nav>
    )
}
